import './history.scss';
import React from 'react';

const History = () => {
  let data = JSON.parse(localStorage.getItem('history'));

  return (
    <div id="history">
      <ul>
        {data
          ? data.map((element, idx) => {
              return (
                <li>
                  <span>{element.method}</span>
                  <button className="idx" id="historyBtn">
                    {element.URL}
                  </button>{' '}
                </li>
              );
            })
          : null}
      </ul>
    </div>
  );
};

export default History;
